import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Auth/Login'; // Your Login component
import AdminDashboard from './components/Admin/AdminDashboard'; // Import AdminDashboard
import { ToastContainer } from 'react-toastify';
import './App.css'; 
const App = () => {
    return (
        <Router>
          <ToastContainer />
            <Routes>
            <Route path="/" element={<Login />} /> {/* Set the default route to Login */}
            <Route path="/admin/dashboard" element={<AdminDashboard />} /> {/* Admin Dashboard route */}
            </Routes>
        </Router>
    );
};

export default App;
